import React, { Component } from 'react';
import './login.css';

class Login extends Component {
    render() {
        return (
            <container>
                <header>
                    <img src="/images/logo_text.png" />
                </header>
                    <content>
                        <div className="loginInput">
                            <input type="text" id="inputId" placeholder="전화번호, 사용자 이름 또는 이메일" />
                                <input type="password" id="inputPw" placeholder="비밀번호" />
                        </div>
                        <div>
                            <button type="button" id="loginButton">로그인</button>
                        </div>
                    </content>
                    <footer>
                        비밀번호를 잊으셨나요?
                    </footer>
            </container>
        )
    }
}

export default Login;
